import Card from '~/components/Card.vue';
import projs from '@/content/projs.json';
export default {
  metaInfo: {
    title: 'test'
  },
  components: {
    Card: Card
  },
  data: function data() {
    return {
      projs: projs
    };
  },
  computed: {
    currentProj: function currentProj() {
      return this.projs.filter(function (projs) {
        return projs.status.match("in progress");
      });
    },
    completedProj: function completedProj() {
      return this.projs.filter(function (projs) {
        return projs.status.match("complete");
      });
    }
  }
};
